import { Typography } from '@material-ui/core'
import React from 'react'
import { Container } from 'reactstrap'

function Report() {
  return (
  <Box>
    <Container>
    <Typography variant='h1'>Recharge Report</Typography>
    </Container>
  </Box>
  )
}

export default Report
